import React from 'react';
import './style.css';
import jetiLogo from '../Stories/Img/jetLogo.jpg';
import { Sidebar } from '../Sidebar'
import { Stories } from '../Stories'

export function Home() {

    return(
        <div className="home-box">
            <Sidebar/>
            <Stories/>
        <div className="feed">
            <ul className="posts">
                <li className="post1">
                <img className="post-profile-pic" src={jetiLogo} align="left" padding-left="10px" alt="Logo" />
                <p className="post-profile-name">jetimobi</p>
                </li>
            </ul>
        </div>
        </div>
    )

}
